/* eslint-disable react/prop-types */
/* eslint-disable react/function-component-definition */
/**
=========================================================

=========================================================

USER DETAILS SHOW

 =========================================================

*/
/*eslint-disable*/

// Material Dashboard 2 React components
import React, { useEffect, useState } from "react";
import axios from "axios";
import { API } from "config/Api";
import { useTable } from "react-table";
import Icon from "@mui/material/Icon";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import ReactSwitch from "react-switch";
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import MDAvatar from "components/MDAvatar";
import MDBadge from "components/MDBadge";
import MDButton from "components/MDButton";

// Images
import team2 from "assets/images/team-2.jpg";
import team3 from "assets/images/team-3.jpg";
import team4 from "assets/images/team-4.jpg";

function UserTable() {
  const adminAccessToken = localStorage.getItem("Admin-Token");
  const [UserList, setUserList] = useState([]);

  const handleChangeCheck = () => {
    console.log("click");
  };

  const handleDeleteUser = (userid) => {
    console.log("delete user", userid);
  };

  useEffect(() => {
    axios
      .get(API.BASE_URL + "userlist/", {
        headers: {
          Authorization: `Bearer ${adminAccessToken}`,
        },
      })
      .then((res) => {
        setUserList(res.data.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  const Author = ({ image, name, email }) => (
    <MDBox display="flex" alignItems="center" lineHeight={1}>
      <MDAvatar src={image} name={name} size="sm" />
      <MDBox ml={2} lineHeight={1}>
        <MDTypography display="block" variant="button" fontWeight="medium">
          {name}
        </MDTypography>
        <MDTypography variant="caption">{email}</MDTypography>
      </MDBox>
    </MDBox>
  );

  const Job = ({ title, description }) => (
    <MDBox lineHeight={1} textAlign="left">
      <MDTypography display="block" variant="caption" color="text" fontWeight="medium">
        {title}
      </MDTypography>
    </MDBox>
  );

  const data = UserList.map((user) => ({
    user: (
      <Author
        image={team4}
        name={user.firstname + " " + user.lastname}
        email={user.email}
        key={user.id}
      />
    ),
    function: <Job title={user.is_admin ? "admin" : "user"} key={user.id} />,
    status: (
      <MDBox ml={-1} key={user.id}>
        <ReactSwitch checked={user.is_active} onChange={handleChangeCheck} />
      </MDBox>
    ),
    created: (
      <MDTypography
        component="a"
        href="#"
        variant="caption"
        color="text"
        fontWeight="medium"
        key={user.id}
      >
        {user.created_at}
      </MDTypography>
    ),
    action: (
      <MDTypography
        component="a"
        href="#"
        variant="caption"
        color="text"
        fontWeight="medium"
        key={user.id}
      >
        <MDBox color="text" px={2}>
          <Icon
            sx={{ cursor: "pointer", fontWeight: "bold" }}
            fontSize="small"
            onClick={(e) => openMenu(e, user.id)} // Pass user.id as an argument
          >
            more_vert
          </Icon>
        </MDBox>
      </MDTypography>
    ),
  }));

  const columns = [
    { Header: "Users", accessor: "user", width: "45%", align: "left" },
    { Header: "Role", accessor: "function", align: "left" },
    { Header: "status", accessor: "status", align: "center" },
    { Header: "Created", accessor: "created", align: "center" },
    { Header: "action", accessor: "action", align: "center" },
  ];

  const {
    getTableProps,
    getTableBodyProps,
    headerGroups,
    rows,
    prepareRow,
  } = useTable({
    columns,
    data,
  });

  const [menu, setMenu] = useState(null);

  const openMenu = (e, userId) => {
    e.preventDefault();
    setMenu({ userId, anchorEl: e.currentTarget });
  };

  const closeMenu = () => {
    setMenu(null);
  };

  return (
    <div>
      <table {...getTableProps()} style={{ width: "100%" }}>
        <thead>
          {headerGroups.map((headerGroup) => (
            <tr {...headerGroup.getHeaderGroupProps()}>
              {headerGroup.headers.map((column) => (
                <th
                  {...column.getHeaderProps()}
                  style={{ textAlign: column.align }}
                >
                  {column.render("Header")}
                </th>
              ))}
            </tr>
          ))}
        </thead>
        <tbody {...getTableBodyProps()}>
          {rows.map((row) => {
            prepareRow(row);
            return (
              <tr {...row.getRowProps()}>
                {row.cells.map((cell) => {
                  return (
                    <td
                      {...cell.getCellProps()}
                      style={{ textAlign: cell.column.align }}
                    >
                      {cell.render("Cell")}
                    </td>
                  );
                })}
              </tr>
            );
          })}
        </tbody>
      </table>
      {menu && (
        <Menu
          id={`menu-${menu.userId}`}
          anchorEl={menu.anchorEl}
          anchorOrigin={{
            vertical: "top",
            horizontal: "left",
          }}
          transformOrigin={{
            vertical: "top",
            horizontal: "right",
          }}
          open={Boolean(menu)}
          onClose={closeMenu}
        >
          <MenuItem
            onClick={() => {
              console.log("Clicked on user.id:", menu.userId);
              handleDeleteUser(menu.userId);
              closeMenu();
            }}
            style={{ color: "danger" }}
          >
            Delete
          </MenuItem>
        </Menu>
      )}
    </div>
  );
}

export default UserTable;
